	add("netsuke", "{\"term\":\"netsuke\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Japanese\"], \"text\":\"Image:Kokei\u0027s dog shaped netsuke.jpg|thumb|250px|A dog-shaped netsuke.From Japanese \u0027lang\u003dja\u0027 Literally \u0027lang\u003dja|根|tr\u003dne\u0027 () + \u0027lang\u003dja|付け|tr\u003dtsuke\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small, often collectible, artistic carving characterized by an opening or two small holes (), most commonly made of wood or ivory, used as a fob at the end of a cord attached to a suspended pouch containing pens, medicines, or tobacco. Netsuke originated in feudal Japan in the late 16th and 17th centuries\", \"priority\":1}]}, \"synonyms\":{}}");

